import Cell from "./Cell";
import Player from "./Player";
import {useState} from "react";
function Road({RoadContent})
{
    const [road, moveRoad] = useState(RoadContent)
    
    return [
        <p>{RoadContent}</p>,
        <table class="road">
            <tr>
                <Player></Player>
                <Cell code={RoadContent[0]}></Cell>
                <Cell code={RoadContent[1]}></Cell>
                <Cell code={RoadContent[2]}></Cell>
                <Cell code={RoadContent[3]}></Cell>
                <Cell code={RoadContent[4]}></Cell>
                <Cell code={RoadContent[5]}></Cell>
                <Cell code={RoadContent[6]}></Cell>
                <Cell code={RoadContent[7]}></Cell>
                <Cell code={RoadContent[8]}></Cell>
                <Cell code={RoadContent[9]}></Cell>
            </tr>
        </table>
    ]
}
export default Road
